import React from "react";
import IndividualInvoice from "./IndividualInvoice";

const InvoiceList = (props) => {
    return (
      <>
        <div className="w-50 center">
          {props.values.map((value) => (
            <IndividualInvoice 
                name={value.name}
            />
          ))}
        </div>
        <div></div>
        </>
    )
};

export default InvoiceList;
